import React from 'react';
import Classes from './MainNavigation.module.css';
import { NavLink } from 'react-router-dom';

function MainNav() {
  return <header classes={Classes.header}>
      <div classes={Classes.logo}>
          Great Quotes
      </div>
      <nav classes={Classes.nav}>
          <ul>
              <li><NavLink to='/quotes' activeClassName={Classes.active}>All Quotes</NavLink></li>
              <li><NavLink to='/new-quote' activeClassName={Classes.active}>All Quotes</NavLink></li>
          </ul>
      </nav>
  </header>
}

export default MainNav;
